import React, { useState } from 'react';
import "../../cssFiles/cm.css";
import AddClientForm from './AddClientForm.js'; // Make sure the path is correct
import searchIcon from '../../images/search.png';

export function ClientManager(props) {
  const [showAddClientForm, setShowAddClientForm] = useState(false);

  const clientData = JSON.parse(props.userData.clientData);
  const groupData = props.userData.groupData;

  // Define the setCurrentDateTime function here
  const setCurrentDateTime = () => {
    // Function logic to set current date and time
    // This might involve setting state here if you manage date/time state in the parent component
    console.log("Setting current date and time...");
    // You may need to adjust this function based on where and how you manage state for date and time
  };

  const toggleAddClientForm = () => setShowAddClientForm(!showAddClientForm);

  return (
    <>
      <div className="cm-top-headers">
        <div id="cm-toggle-add-client" onClick={toggleAddClientForm}>Add Client</div>
        <div id="cm-search"><h1>Search</h1><img id='cm-search-icon' src={searchIcon} /></div>
      </div>

      {showAddClientForm && <AddClientForm setCurrentDateTime={setCurrentDateTime} />}

      {/* The rest of your component that renders clientData */}
    </>
  );
}
